import React, { useState } from 'react';
import Component1 from './FloridaMap';
import "../styling/Gallery.css"

const GallerySwitch = ({ date, account_types }) => {
    const [activeComponent, setActiveComponent] = useState(1);

    const handleArrowClick = (direction) => {
        setActiveComponent((prevComponent) => {
            if (direction === 'left') {
                return prevComponent === 1 ? 2 : 1;
            } else {
                return prevComponent === 2 ? 1 : 2;
            }
        });
    };

    return (
        <div className="Gallery">
            <div className="Arrow_Container">
                <div className="Left_Arrow" onClick={() => handleArrowClick('left')}>
                    &larr;
                </div>
                <div className="Right_Arrow" onClick={() => handleArrowClick('right')}>
                    &rarr;
                </div>
            </div>
            {activeComponent === 1 && <Component1 date={date} account_types={account_types} />}
            {activeComponent === 2 && <p />}
        </div>
    );
};

export default GallerySwitch;
